import React from "react";
import QuantityCahnger from "../../../../shared/QuantityChanger";
import "./index.scss";

function CartRow({ item: { id, name, price, quantity } }) {
  return (
    <tr key={id}>
      <td>{name}</td>
      <td>{price}</td>
      <td>
        <QuantityCahnger
          className="cart-row__quantity-changer"
          id={id}
          quantity={quantity}
        />
      </td>
      <td>{quantity * price}</td>
    </tr>
  );
}

export default CartRow;
